const getBreeds = async () => {
    const url = "http://localhost:8000/showAPI";
    const res = await fetch(url);
    const [ breeds ] = await res.json();

    const { url_image: image,  } = dog

    const dog = {
	image: image,
	breed: {
		id: 1,
		name: "Labrador",
	}
}

    return breeds
}

export default getBreeds
